import { Card } from "antd";
import "./UspCard.css";

export const UspCard = (props) => {
  const usp = props?.data;
  return (
    <Card className="usp-card">
      <div style={{ height: "100px" }}>
        <h1>{usp?.title}</h1>
        <h1>{usp?.description}</h1>
      </div>
      <Card>
        <img src={usp?.img} />
      </Card>
    </Card>
  );
};
